import React from "react";
import { Box, Heading } from "@chakra-ui/react";

function TrendingProduct(props) {
  // eslint-disable-next-line

  return (
    <>
      <ProdContainer {...props}>
        <ProdContainerHeader />
        <ProdContainerItems />
      </ProdContainer>
    </>
  );
}
const ProdContainerHeader = () => {
  return (
    <>
      <Box
        px="1.5rem"
        property=""
        display="flex"
        justifyContent={["center", "flex-start", "flex-start", "flex-start"]}
      >
        <Heading
          fontSize={["1.5rem", "1.75rem"]}
          fontWeight={["500", "600"]}
          as="h2"
          color="#2c2c2c"
        >
          <Box display={["inline-block"]}>Hot Products</Box>
          <Box
            borderBottom="2px solid #e97730"
            py={["1"]}
            pos={["relative"]}
            w={["70%", "6x`0%"]}
            left={["4", "4"]}
            right={["4", "4"]}
          ></Box>
        </Heading>
      </Box>
    </>
  );
};

const ProdContainerItems = () => {
  return (
    <>
      <Box>this is ProdContainer Items</Box>
    </>
  );
};
const ProdContainer = ({ children, ...props }) => {
  return <Box as="prodContainer">{children}</Box>;
};

export default TrendingProduct;
